INSERT INTO `fasilitas` (`kd_fasilitas`, `nama`, `gambar`, `detail`, `link`) VALUES
(1, 'Merek', 'ca5e87920309e2aa1c80f7a0fb58b436.jpeg', '<p align=\"justify\">Merek adalah tanda yang dapat ditampilkan secara grafis berupa gambar, logo, nama, kata, huruf, angka, susunan warna, dalam bentuk 2 (dua) dimensi dan/atau 3 {tiga) dimensi, suara, hologram, atau kombinasi dari 2 (dua) atau lebih unsur tersebut untuk membedakan barang dan/atau jasa yang diproduksi oleh orang atau badan hukum dalam kegiatan perdagangan barang dan/atau jasa.</p>\n', 'merek'),
(2, 'Hak Cipta', 'a57fdd362103b5f6b900922515dc3d31.jpeg', '<p align=\"justify\">Hak Cipta adalah hak eksklusif pencipta yang timbul secara otomatis berdasarkan prinsip deklaratif setelah suatu ciptaan diwujudkan dalam bentuk nyata tanpa mengurangi pembatasan sesuai dengan ketentuan peraturan perundang-undangan.  Pemegang Hak Cipta adalah Pencipta sebagai Pemilik Hak Cipta atau pihak yang menerima hak tersebut secara sah dari pencipta, atau pihak lain yang menerima lebih lanjut hak dari pihak yang menerima hak tersebut.</p>\n', 'hakcipta'),
(3, 'Desain Industri', '39a6efb28ee1c5cd41fb16c31cdff585.jpeg', '<p align=\"justify\">Desain Industri adalah suatu kreasi tentang bentuk, konfigurasi atau komposisi garis atau warna, atau garis dan warna, atau gabungan daripadanya yang berbentuk tiga dimensi atau dua dimensi yang memberikan kesan estetis dan dapat diwujudkan dalam pola tiga dimensi atau dua dimensi serta dapat dipakai untuk menghasilkan suatu produk, barang, komoditas industri atau kerajinan tangan.</p>\n', 'desain'),
(4, 'Paten', '67322162ba400816668dc2b6542875d1.jpeg', '<p align=\"justify\">Paten adalah hak eksklusif yang diberikan oleh Negara kepada Inventor atas hasil Invensinya dibidang teknologi, untuk jangka waktu tertentu melaksanakan sendiri Invensi tersebut atau memberikan persetujuan kepada pihak lain untuk melaksanakannya.</p>\n', 'paten');
