INSERT INTO `kelas` (`id`, `kelas`, `desk`) VALUES
(1, 'Tidak Tahu', 'Tidak Tahu'),
(2, 'Kelas 1', 'Bahan kimia yang dipakai dalam industri, ilmu pengetahuan dan fotografi, maupun dalam pertanian, perkebunan, dan kehutanan, damar tiruan yang tidak diolah, plastik yang tidak diolah, pupuk, komposisi bahan pemadam api, sediaan pelunak dan pematri, zat-zat kimia untuk mengawetkan makanan, zat-zat penyamak perekat yang dipakai dalam industri'),
(3, 'Kelas 2', 'Cat-cat, pernis-pernis, lak-Iak, bahan pencegah karat dan kelapukan kayu, bahan pewarna, pembetsa/pengering, bahan mentah, damar alam, logam dalam bentuk lembaran dan bubuk untuk para pelukis, penata dekor, pencetak dan seniman'),
(4, 'Kelas 3', 'Sediaan pemutih dan za t-zat lainnya untuk mencuci, sediaan untuk membersihkan, mengkilapkan, membuang lemak dan menggosok, sabun, wangi-wangian, minyak atsiri, kosmetik, losion rambut, bahan-bahan pemelihara gigi'),
(5, 'Kelas 4', 'Minyak-minyak dan lemak-Iemak untuk industri, bahan pelumas, komposisi zat untuk menyerap, membasahi dan mengikat debu, bahan bakar (termasuk larutan hasil penyulingan untuk motor) dan bahan-bahan penerangan, lilin-lilin, sumbu-sumbu'),
(6, 'Kelas 5', 'Sediaan hasil farmasi, ilmu kehewanan dan saniter, bahan-bahan untuk berpantang makan/diet yang disesuaikan untuk pemakaian medis, makanan bayi, plester-plester, bahan-bahan pembalut, bahan-bahan untuk menambal gigi, bahan pembuat gigi palsu, pembasmi kuman, sediaan untuk membasmi binatang perusak, jamur, tumbuh-tumbuhan'),
(7, 'Kelas 6', 'Logam-Iogam biasa dan campurannya, bahan bangunan dari logam, bangunan-bangunan dari logam yang dapat diangkut, bahan-bahan dari logam untuk jalan kereta api, kabel dan kawat-kawat dari logam biasa bukan untuk listrik, barang-barang besi, benda-benda kecil dari logam besi, pipa-pipa dan tabung-tabung dari logam, lemari-lemari besi barang-barang dari besi biasa yang tidak termasuk dalam kelas-kelas lain, semacam bijihbijihan'),
(8, 'Kelas 7', 'Mesin-mesin dan mesin-mesin perkakas, motor-motor dan mesin-mesin (kecuali untuk kendaraan darat), kopeling mesin dan komponen transmisi (kecuali untuk kendaraan darat), perkakas pertanian, mesin tetas untuk telur'),
(9, 'Kelas 8', 'Alat-alat dan perkakas tangan (dijalankan dengan tangan) , alat-alat pemotong, pedang, pisau silet'),
(10, 'Kelas 9', 'Aparat dan instrumen ilmu pengetahuan, pelayaran, geodesi, listrik, fotografi, sinematografi, optik, timbang, ukur, sinyal, pemeriksaan (pengawasan) , penyelamatan dan pendidikan, aparat untuk merekam, mengirim atau mereproduksi suara atau gambar, pembawa data magnetik, disk perekam, mesin-mesin otomat dan mekanisme untuk aparat yang bekerja dengan memasukkan kepingan logam ke dalamnya, mesin kas, mesin hitung, peralatan pengolah data dan komputer, aparat pemadam kebakaran'),
(11, 'Kelas 10', 'Aparat dan instrumen pembedahan, pengobatan, kedokteran, kedokteran gigi dan kedokteran hewan, anggota badan, mata dan gigi palsu, bendabenda ortopedik, bahan-bahan untuk penjahitan luka bedah'),
(12, 'Kelas 11', 'Aparat/alat untuk keperluan penerangan, pemanasan, penghasil uap, pemasak, pendinginan, pengeringan, penyegaran udara, penyediaan air dan kebersihan'),
(13, 'Kelas 12', 'Kendaraan-kendaraan, udara atau air, aparat/alat untuk bergerak di darat'),
(14, 'Kelas 13', 'Senjata-senjata api, amunisi-amunisi dan proyektil-proyektil, bahan peledak, kembang api, petasan'),
(15, 'Kelas 14', 'Logam-Iogam mulia serta campuran-campurannya dan benda-benda yang dibuat dari logam mulia atau yang dibalut dengan bahan itu, yang tidak termasuk dalam kelas-kelas lainnya, perhiasan, batu-batu mulia, jam-jam dan instrumen pengukur waktu'),
(16, 'Kelas 15', 'Alat-alat musik'),
(17, 'Kelas 16', 'Kertas, karton dan barang-barang yang terbuat dari bahan-bahan ini, yang tidak termasuk kelas-kelas lain, barang-barang cetakan, bahan-bahan untuk menjilid buku, potret-potret, alat tulis-menulis perekat untuk keperluan alat tulis-menulis atau rumah tangga alat-alat kesenian kwas untuk cat mesin tik dan keperluan kantor (kecuali perabot kantor), bahan pendidikan dan pengajaran (kecuali aparat-aparat), bahan-bahan plastik untuk pembungkus (yang tidak termasuk kelas-kelas lain), kartu-kartu main, huruf-huruf cetak, klise-klise'),
(18, 'Kelas 17', 'Karet, getah-perca, getah, asbes, mika dan barang-barang terbuat dari bahan-bahan tersebut dan tidak termasuk kelas-kelas lain, plastik-plastik yang sudah berbentuk untuk digunakan da la m pembuatan barang, bahan-bahan untuk membungkus, merapatkan dan menyekat, pipa-pipa lentur, bukan dari logam'),
(19, 'Kelas 18', 'Kulit dan kulit imitasi, dan barang-barang terbuat dari bahan-bahan ini dan tidak termasuk dalam kelas-kelas lain, kulit-kulit halus binatang, kulit mentah, koper-koper dan tas-tas untuk tamasya, payung hujan, payung matahari dan tongkat-tongkat, cambuk-cambuk, pelana dan peralatan kuda dari kulit'),
(20, 'Kelas 19', 'Bahan-bahan bangunan (bukan logam), pipa-pipa kaku bukan dari logam untuk bangunan, aspal, pek, bitumen, bangunan yang dapat dipindah pindah bukan dari logam, monumen-monumen, bukan dari logam'),
(21, 'Kelas 20', 'Perabot-perabot rumah, cermin-cermin, bingkai gambar, benda-benda (yang tidak termasuk dalam kelas-kelas lain) dari kayu, gabus, rumput, buluh, rotan, tanduk, tulang, gading, balein, kulit kerang, amber, kulit mutiara, tanah liat magnesium dan bahan-bahan penggantinya, atau dari plastik'),
(22, 'Kelas 21', 'Perkakas dan wadah-wadah untuk rumah tangga atau dapur (bukan dari logam mulia atau yang dilapisi logam mulia) sisir-sisir dan bunga-bunga karang, sikat-sikat (kecuali kwas-kwas), bahan pembuat sikat, benda-benda untuk membersihkan, wol, baja, kaca yang belum atau setengah dikerjakan (kecuali kaca yang dipakai dalam bangunan), gelas-gelas, porselin dan pecah belah dari tembikar yang tidak termasuk dalam kelas-kelas lain'),
(23, 'Kelas 22', 'Tambang, tali, jala-jala, tenda-tenda, tirai, kain terpal, layar-Iayar, sak-sak dan kantong-kantong (yang tidak termasuk dalam kelas-kelas lain), bahan-bahan pelapis dan pengisi bantal (kecuali dari karet atau plastik), serat-serat kasar untuk pertenunan'),
(24, 'Kelas 23', 'Benang-benang untuk tekstil'),
(25, 'Kelas 24', 'Tekstil dan barang-barang tekstil, yang tidak termasuk dalam kelas-kelas lain, kasur tempat tidur dan meja'),
(26, 'Kelas 25', 'Pakaian, alas kaki, tutup kepala'),
(27, 'Kelas 26', 'Renda-renda dan sulaman-sulaman, pita-pita dan jalinan-jalinan dari pita, kancing-kancing kail dan mata kait, jarum-jarum pentul dan jarum-jarum, bunga-bunga buatan'),
(28, 'Kelas 27', 'Karpet-karpet, permadani, keset berbahan anyaman, linoleum dan bahan-bahan lain untuk penutup ubin, hiasan-hiasan gantung dinding (bukan dari tekstil)'),
(29, 'Kelas 28', 'Mainan-mainan, alat-alat senam dan olah-raga yang tidak termasuk kelas-kelas lain, hiasan pohon natal'),
(30, 'Kelas 29', 'Daging, ikan, unggas dan binatang buruan, saripati daging, buah-buahan dan sayuran yang diawetkan, dikeringkan dan dimasak, agar-agar, selai-selai, saus dari buah-buahan, telur, susu dan hasil-hasil produksi susu, minyak dan lemak-Iemak yang dapat dimakan'),
(31, 'Kelas 30', 'Kopi, teh, kakao, gula, beras, tapioka, sagu, kopi olahan, tepung dan bahan baku terbuat dari gandum, roti, kue-kue dan kembang gula, minuman es, madu, air gula, ragi bubuk pengembang roti/kue, garam, moster, cuka, saus-saus (bumbu-bumbu) rempah-rempah, es, kecap, tauco, trasi, petis, krupuk, emping'),
(32, 'Kelas 31', 'Hasil-hasil produksi pertanian, perkebunan, kehutanan dan jenis-jenis gandum yang tidak termasuk dalam kelas-kelas lain, binatang-binatang hidup, buah-buahan dan sayuran segar, benih-benih, tanaman dan bunga-bunga alami, makanan hewan'),
(33, 'Kelas 32', 'Bir dan berbagai jenis-jenis bir, air mineral dan air soda dan minuman bukan alkohol lainnya, minuman-minuman dari buah dan perasan buah, sirop-sirop dan sediaan-sediaan lain untuk membuat minuman'),
(34, 'Kelas 33', 'Minum-minuman keras (kecuali bir)'),
(35, 'Kelas 34', 'Tembakau, barang-barang keperluan merokok, korek api');
