INSERT INTO `konten01` (`kd_konten01`, `nama`, `gambar`, `detail`) VALUES
(1, 'Mereka', '3e2b40d6ec0a91b32c66ba598fc901bb.jpg', '<p>Mereka adalah tanda yang dapat ditampilkan secara grafis berupa gambar, logo, nama, kata, huruf, angka, susunan warna, dalam bentuk 2 (dua) dimensi dan/atau 3 {tiga) dimensi, suara, hologram, atau kombinasi dari 2 (dua) atau lebih unsur tersebut untuk membedakan barang dan/atau jasa yang diproduksi oleh orang atau badan hukum dalam kegiatan perdagangan barang dan/atau jasa</p>\r\n'),
(2, 'Hak Ciptah', 'd150c4b7f950ed2ada52287b0f1f24e1.jpg', '<p>Hak Cipta merupakan salah satu bagian dari kekayaan intelektual yang memiliki ruang lingkup objek dilindungi paling luas, karena mencakup ilmu pengetahuan, seni dan sastra (art and literary) yang di dalamnya mencakup pula program komputer.</p>\r\n\r\n<p>Perkembangan ekonomi kreatif yang menjadi salah satu andalan Indonesia dan berbagai negara dan berkembang pesatnya teknologi informasi dan komunikasi mengharuskan adanya pembaruan Undang-Undang Hak Cipta, mengingat Hak Cipta menjadi basis terpenting dari ekonomi kreatif nasional.</p>\r\n'),
(3, 'Desain Industri', '10de2702b4248797736747148948f0c2.png', '<p>Desain Industri adalah suatu kreasi tentang bentuk, konfigurasi atau komposisi garis atau warna, atau garis dan warna, atau gabungan daripadanya yang berbentuk tiga dimensi atau dua dimensi yang memberikan kesan estetis dan dapat diwujudkan dalam pola tiga dimensi atau dua dimensi serta dapat dipakai untuk menghasilkan suatu produk, barang, komoditas industri atau kerajinan tangan.</p>\r\n');
INSERT INTO `lasbar` (`kelas`) VALUES
