(1, 'Tentang KI', '<h3>Kekayaan Intelektual</h3>\r <p class=\"text-justify\">Kekayaan Intelektual, disingkat KI adalah hak yang timbul sebagai hasil olah pikir yang menghasilkan suatu produk atau proses yang berguna untuk manusia. Pada intinya KI adalah hak untuk menikmati secara ekonomis dari suatu kreativitas intelektual. Obyek dalam HKI adalah karya karya yang timbul atau lahir karena kemampuan intelektual manusia.</p>', 'paten.png');
