INSERT INTO `tentangki` (`kd_tentangki`, `nama`, `gambar`, `detail`, `detailing`, `link_detail`) VALUES
(1, 'Latar Belakang', 'd20da6de4ed19d98ec3b71cffeba7eb1.jpeg', '<p align=\"justify\">Timbulnya berbagai masalah dan sengketa hukum dalam perlindungan KI membutuhkan penegakkan hukum yang tegas dan upaya bersama dalam memberantas pelanggaran peraturan KI. Untuk mewujudkan kebijakan yang strategis tersebut dan memberikan pelindungan hukum terhadap produk-produk khusus IKM, maka Direktorat Jenderal Industri Kecil, Menengah dan Aneka (Ditjen IKMA) Kementerian Perindustrian telah mendirikan Klinik KI–IKM sebagai upaya meminimalisir kasus-kasus yang timbul di IKM.</p>\r\n', '<p align=\"justify\">Industri Kecil dan Menengah (IKM) adalah salah satu sub sektor ekonomi strategis karena memberikan sumbangan yang besar terhadap perekonomian nasional. Pada tahun 2018, jumlah unit usaha IKM mencapai ± 4,29 juta unit usaha dan menyerap tenaga kerja sebanyak 10,56 juta orang. Dengan kontribusi tersebut, IKM memiliki peran untuk membuka peluang usaha, menyerap tenaga kerja dalam jumlah besar, memberikan nilai tambah pada hasil produksi serta berkontribusi terhadap pemasukan devisa melalui ekspor yang turut serta mendorong pertumbuhan ekonomi.<br/><br/>\r\nUntuk lebih meningkatkan peranan IKM dalam perekonomian nasional, berbagai kebijakan dan program yang mendukung penumbuhan dan pengembangan IKM telah banyak diterbitkan, diantaranya pemberian fasilitas melalui pengembangan produk IKM, restrukturisasi mesin; promosi dan pameran; serta penguatan kelembagaan melalui pengembangan sentra IKM dan peningkatan kemampuan Unit Pelayanan Teknis (UPT). Program dukungan tersebut dimaksudkan untuk meningkatkan daya saing IKM, baik persaingan antara usaha besar dengan kecil dan menengah maupun persaingan usaha antar negara.<br/><br/>\r\nDalam perkembangan arus perdagangan bebas serta kemajuan teknologi, komunikasi dan informasi, transaksi perdagangan produk dan jasa semakin cepat dan tak terbatas. Perkembangan di pasar internasional juga ditindaklanjuti dengan kesepakatan perdagangan internasional oleh Negara-negara anggota World Trade Organization (WTO) untuk melancarkan arus distribusi barang, jasa dan investasi dengan mengurangi secara bertahap hambatan-hambatan tarif bea masuk. Hal ini menuntut adanya standard kualitas produk dan jasa, persaingan usaha yang sehat serta adanya komitmen terhadap peraturan perdagangan internasional yang disepakati bersama.<br/><br/>\r\nMengingat liberalisasi perdagangan yang persaingannya sangat ketat khususnya di pasar internasional, selain meningkatkan daya saing, IKM perlu menjaga daya saing yang telah dimiliki antara lain dengan melindungi Intellectual Property Rights (IPR). Pasar tunggal ASEAN merupakan salah satu contoh bahwa dengan bebasnya peredaran barang dan jasa antar negara ASEAN, memberikan pembinaan dan pelindungan terkait Kekayaan Intelektual (KI) adalah hal yang mutlak diperlukan sebagai upaya pelindungan dari praktek-praktek peniruan, penjiplakan atas produk barang dan jasa karya intelektual.<br/><br/>\r\nKetentuan tentang Trade-Related Aspects of Intellectual Property Rights (TRIPs) sebagai bagian yang tidak terpisahkan dari ketentuan WTO merupakan ketentuan yang berlaku dalam sistem liberalisasi perdagangan antar negara anggota WTO.<br/><br/>\r\nLatar belakang lahirnya World Trade Organization (WTO/ TRIP’s) didasari oleh banyaknya kasus sengketa perdagangan, antara lain pembatasan impor melalui tarif bea masuk tinggi dalam rangka melindungi industri dalam negeri, pemberian subsidi yang berlebihan, diskriminasi pasar domestik, diskriminasi standar barang, serta perdagangan barang palsu dan pembajakan. Selain itu, terdapat kecenderungan negara-negara maju menggunakan kebijakan unilateral dan menerapkan praktek-praktek perdagangan yang bersifat anti persaingan dalam menghambat impor dan melakukan proteksi domestik secara tidak wajar. Hal ini dilakukan dengan mengkaitkan perdagangan dengan masalah-masalah terkait KI. <br/><br/>\r\nIndonesia telah meratifikasi ketentuan Trade Related Aspects of Intellectual Property Rights (TRIPs) melalui Undang-Undang Nomor 7 Tahun 1994 tentang Pengesahan Agreement Establishing The World Trade Organization (WTO) yang mencakup juga tentang Trade Related Aspects of Intellectual Property Rights-Including Trade in Counterfeit Goods/ TRIPs (aspek-aspek KI yang terkait dengan perdagangan). Adapun Undang-Undang Nomor 7 Tahun 1994 mengamanatkan hal-hal tentang:<br/><br/>\r\n<ol>\r\n<li> Meningkatkan pelindungan terhadap KI dari produk-produk yang diperdagangkan;</li><br/>\r\n<li> Menjamin prosedur pelaksanaan KI yang tidak menghambat kegiatan perdagangan;</li><br/>\r\n<li> Merumuskan aturan serta disiplin mengenai pelaksanaan pelindungan terhadap KI; dan</li><br/>\r\n<li> Mengemban prinsip, aturan, mekanisme kerjasama internasional untuk menangani perdagangan barang-barang hasil pemalsuan atau pembajakan atas KI.</li>\r\n</ol><p>\r\n<p align=\"justify\"><Dalam perdagangan internasional, klasifikasi tidak dilakukan berdasarkan hasil produksi industri besar, menengah atau kecil, namun berdasarkan klasifikasi barang menurut Harmony System Nomenclature. Oleh karena itu, pelaku IKM wajib untuk memahami ketentuan TRIPs/ KI dalam rangka menghadapi persaingan dalam era liberalisasi perdagangan khususnya yang akan melakukan pemasaran internasional.<br/><br/>\r\nDalam menghadapi liberalisasi ekonomi, IKM masih memiliki berbagai keterbatasan diantaranya kemampuan untuk mengakses sumber daya produktif dan dalam menerapkan berbagai peraturan yang diberlakukan oleh WTO di era perdagangan bebas. Penerapan KI pada era liberalisasi saat ini sangat penting untuk kelangsungan dan pengembangan usaha IKM, oleh karenanya informasi yang berkaitan dengan substansi KI harus disosialisasikan dengan lebih intensif kepada pelaku usaha IKM.<br/><br/> Timbulnya berbagai masalah dan sengketa hukum dalam perlindungan KI membutuhkan penegakkan hukum yang tegas dan upaya bersama dalam memberantas pelanggaran peraturan KI. Dengan penegakan hukum KI secara optimal diharapkan agar sektor swasta, mulai dari IKM hingga industri besar dapat memanfaatkan aset kekayaan intelektualnya dalam industri dan ekonomi yang berbasis ilmu pengetahuan. Untuk mewujudkan kebijakan yang strategis tersebut dan memberikan pelindungan hukum terhadap produk-produk khusus IKM, maka Direktorat Jenderal Industri Kecil, Menengah dan Aneka (Ditjen IKMA) Kementerian Perindustrian telah mendirikan Klinik KI–IKM sebagai upaya meminimalisir kasus-kasus yang timbul di IKM.<br/><br/>\r\nBeberapa kegiatan yang telah diimplementasikan antara lain sosialisasi kebijakan, bimbingan layanan dan advokasi, serta pelatihan teknis KI pada instansi-instansi terkait dan dunia usaha IKM. <br/><br/> Melihat kenyataan tersebut, maka Ditjen IKMA telah mendirikan Klinik Hak Kekayaan Intelektual pada tahun 1998, yang selanjutnya disebut Klinik HKI-IKM. Unit tersebut merupakan unit kerja ad hoc yang memberikan pelayanan di bidang KI. Pendirian Klinik HKI-IKM dimaksudkan untuk memfasilitasi IKM yang tersebar luas di seluruh wilayah Indonesia dan sebagian besar berada di pedesaan. Kemampuan IKM untuk melindungi produknya melalui pendaftaran KI sangatlah terbatas, disebabkan lokasi IKM yang tersebar luas di seluruh Indonesia dan pemahaman IKM terhadap KI yang masih sangat terbatas. Melalui Klinik HKI-IKM, penyebaran informasi, fasilitasi pendaftaran KI, dan advokasi diharapkan dapat dilakukan dengan lebih efisien dan efektif. Sejak berdirinya, Klinik HKI-IKM telah melakukan berbagai kegiatan bimbingan dan konsultasi, promosi dan penyebaran informasi, layanan advokasi serta kerja sama dengan instansi terkait, sentra-sentra KI, perguruan tinggi, serta lembaga penelitian dan pengembangan. <br/><br/> Untuk lebih menyebarluaskan informasi KI bagi IKM di berbagai daerah maka Klinik HKI-IKM telah melakukan pelatihan Fasilitator bagi Aparat, baik yang berasal dari Pusat, Provinsi maupun Kabupaten/ Kota. Jumlah Fasilitator yang telah terlatih dan mendapatkan sertifikat sebagai Tenaga Fasilitator KI telah berjumlah sebanyak 1075 orang yang tersebar di Pusat, Provinsi dan Kabupaten/ Kota. <br/><br/> Pada beberapa daerah, Dinas Perindustrian Provinsi dan Kabupaten/ Kota telah mendirikan Klinik HKI, dimana fasilitator tersebut berperan aktif dalam pelindungan KI untuk IKM. Fasilitator Daerah merupakan mitra kerja Klinik HKI Ditjen IKMA yang memberikan penyuluhan, bimbingan dan penyebaran informasi bagi IKM. Melalui kerja sama tersebut telah diperoleh hasil yang cukup baik, terlihat dari peningkatan pendaftaran KI oleh pengusaha IKM dari tahun ke tahun. Untuk mengoptimalkan kegiatan bimbingan dan penerapan KI di masyarakat, Ditjen IKMA terus memacu program pembinaan dan pengembangan KI melalui Klinik HKI-IKM.</p>', 'latarbelakang'),
(2, 'Pengertian KI', 'dec780e8d5a5671384f176da86c7a22d.jpeg', '<p align=\"justify\">Secara substantif pengertian KI dapat didefinisikan sebagai kekayaan yang timbul atau lahir dari kemampuan intelektual manusia. Karya-karya yang timbul atau lahir dari kemampuan intelektual manusia dapat berupa karya-karya di bidang teknologi, ilmu pengetahuan, seni dan sastra yang dilahirkan dengan pengorbanan tenaga, waktu dan bahkan biaya. Pengorbanan tersebut menjadikan karya yang dihasilkan memiliki nilai ekonomi. Manfaat lain yang dapat dinikmati adalah melekatnya konsepsi kekayaan (property) terhadap karya-karya intelektual bagi dunia usaha, karya-karya itu dikatakan sebagai aset perusahaan.</p>\r\n', '', 'pengertian'),
(3, 'Visi dan Misi', '81150aa58d5bc8fe198f7c6c5225eb16.jpeg', '<p align=\"justify\">Klinik Hak Kekayaan Intelektual Direktorat Jenderal Industri Kecil, Menengah dan Aneka yang selanjutnya disebut Klinik KI Ditjen IKMA adalah unit kerja yang berfungsi melaksanakan pembinaan dan penerapan Kekayaan Inteletual (KI) kepada aparatur pembina IKM dan masyarakat Industri khususnya IKM.</p>\r\n', '', 'visimisi'),
(4, 'Layanan Klinik KI Ditjen IKMA', '35c8e130a01a17332532ffd44a9b919b.jpeg', '<p>Dalam pelaksanaan kegiatan, Klinik KI-IKM memberikan layanan berupa bimbingan dan konsultasi terkait KI, fasilitasi kepada IKM berupa permohonan pendaftaran, pemberian informasi tentang KI pada IKM dan masyarakat luas dengan turut berpartisipasi dalam berbagai event pameran di dalam negeri, memberikan fasilitasi layanan konsultasi kepada IKM dan melakukan kerjasama kelembagaan dengan instansi terkait dan stakeholder lainnya di bidang KI.</p>\r\n', '', 'layanan');
